import math

def is_prime(n):
    if n < 1:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def generate_fibonacci(n):
    if isinstance(n, float):
        n = int(n)
    elif isinstance(n, str):
        try:
            n = int(n)
        except ValueError:
            return []
    elif not isinstance(n, int):
        return []
    if n < 0 or is_prime(n):
        return []
    fibonacci = []
    (a, b) = (0, 1)
    while b <= n:
        fibonacci.append(b)
        (a, b) = (b, a + b)
    return fibonacci[::-1]

